function FeedbackList({ feedback}) {
  if(!feedback || feedback.length===0)  {
    return <p>No Feedback Yet Has Been Provided</p>
  }
  return (
    <div className="feedback-list">
      {feedback.map((item) => (
        <div>{item.rating}</div>
      )
      )
      }
    </div>
  )
}

export default FeedbackList
